(101,76,0,33,'<section class=\"d_wrapper\">\r\n<h3>DETAILS</h3>\r\n<div class=\"d_content\">A woven set featuring a tube top with a straight-cut neckline and back, button-front closures, belted waist, and faux front flap pockets, as well as a pair of matching pants with a high-rise waist, zip fly and hook-and-bar front closure, and straight leg.</div>\r\n</section>\r\n<section class=\"d_wrapper\">\r\n<h3>Content + Care</h3>\r\n<div class=\"d_content\">\r\n<p>- 100% polyester</p>\r\n<p>- Hand wash cold</p>\r\n</div>\r\n</section>\r\n<section class=\"d_wrapper\">\r\n<h3>Size + Fit</h3>\r\n<div class=\"d_content\">\r\n<p>- Model is 5\'9\" and wearing a Small</p>\r\n</div>\r\n</section>'),
(102,76,0,97,'<section class=\"d_wrapper\">\r\n<h3>DETAILS</h3>\r\n<div class=\"d_content\"><strong>Forever 21 Kids</strong>&nbsp;- A fleece hoodie featuring a heathered construction, hood, zip-up front closure, split kangaroo pocket, long sleeves, and ribbed trim.</div>\r\n</section>\r\n<section class=\"d_wrapper\">\r\n<h3>Content + Care</h3>\r\n<div class=\"d_content\">\r\n<p>- Shell: 57% cotton, 43% polyester</p>\r\n<p>- Lining: 66% polyester, 34% cotton</p>\r\n<p>- Machine wash cold</p>\r\n</div>\r\n</section>\r\n<section class=\"d_wrapper\">\r\n<h3>Size + Fit</h3>\r\n<div class=\"d_content\">\r\n<p>- Measured from a Size 7/8</p>\r\n<p>- Full length: 20.75\"</p>\r\n<p>- Chest: 17\"</p>\r\n<p>- Waist: 16.75\"</p>\r\n<p>- Sleeve length: 16.75\"</p>\r\n</div>\r\n</section>'),
(103,76,0,1,'<div class=\"product attribute overview\">\r\n<div class=\"value\">\r\n<div class=\"pdp__description\">\r\n<section class=\"d_wrapper\">\r\n<h3>Details</h3>\r\n<div class=\"d_content\">A knit shirt featuring a textured construction, Cuban collar, button-front closures, chest patch pocket, and short sleeves.</div>\r\n</section>\r\n<section class=\"d_wrapper\">\r\n<h3>Content + Care</h3>\r\n<div class=\"d_content\">\r\n<p>- 59% cotton, 41% polyester</p>\r\n<p>- Machine wash cold</p>\r\n</div>\r\n</section>\r\n<section class=\"d_wrapper\">\r\n<h3>Size + Fit</h3>\r\n<div class=\"d_content\">\r\n<p>- Model is 6\'1\" and wearing a Medium</p>\r\n</div>\r\n</section>\r\n</div>\r\n</div>\r\n</div>'),
(104,76,0,9,'<div class=\"pdp__description\">\r\n<section class=\"d_wrapper\">\r\n<h3>Details</h3>\r\n<div class=\"d_content\">A knit shirt featuring a textured construction, Cuban collar, button-front closures, chest patch pocket, and short sleeves.</div>\r\n</section>\r\n<section class=\"d_wrapper\">\r\n<h3>Content + Care</h3>\r\n<div class=\"d_content\">\r\n<p>- 59% cotton, 41% polyester</p>\r\n<p>- Machine wash cold</p>\r\n</div>\r\n</section>\r\n<section class=\"d_wrapper\">\r\n<h3>Size + Fit</h3>\r\n<div class=\"d_content\">\r\n<p>- Model is 6\'1\" and wearing a Medium</p>\r\n</div>\r\n</section>\r\n</div>'),
(105,76,0,2,'<div class=\"pdp__description\">\r\n<section class=\"d_wrapper\">\r\n<h3>Details</h3>\r\n<div class=\"d_content\">A non-stretch denim dress featuring a mini length, button-front closures, a basic collar, chest patch pockets, belt loops, long sleeves with buttoned cuffs, and a frayed hem.(This item runs small, please size up.)</div>\r\n</section>\r\n<section class=\"d_wrapper\">\r\n<h3>Content + Care</h3>\r\n<div class=\"d_content\">\r\n<p>- 100% cotton</p>\r\n<p>- Machine wash cold</p>\r\n</div>\r\n</section>\r\n<section class=\"d_wrapper\">\r\n<h3>Size + Fit</h3>\r\n<div class=\"d_content\">\r\n<p>- Model is 5\'7.5\" and wearing a Small</p>\r\n</div>\r\n</section>\r\n</div>'),
