INSERT INTO `magefan_blog_post` VALUES
(1,'Giới thiệu LQK Fashion',NULL,'magento 2 blog sample','Magento 2 blog default post.',0,'magento-2-blog-post-sample',NULL,NULL,NULL,NULL,'Magento 2 Blog Post Sample','<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;!DOCTYPE html&gt;\r\n&lt;html lang=\"vi\"&gt;\r\n\r\n&lt;head&gt;\r\n    &lt;meta charset=\"UTF-8\"&gt;\r\n    &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\r\n    &lt;title&gt;Giới Thiệu - LQK Fashion&lt;/title&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body style=\"font-family: Arial, sans-serif; line-height: 1.6; margin: 0; padding: 0; background-color: #f4f4f4;\"&gt;\r\n    &lt;div style=\"width: 100%; margin: auto; overflow: hidden;\"&gt;\r\n        &lt;div style=\"background: #fff; padding: 10px;margin-top: 20px; box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);\"&gt;\r\n            &lt;h2 style=\"color: #333;\"&gt;LQK Fashion - Nơi Thời Trang Tỏa Sáng&lt;/h2&gt;\r\n            &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Chào mừng bạn đến với &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt;, nơi mang đến cho bạn những sản phẩm thời trang đẹp nhất và chất lượng nhất. Chúng tôi tự hào là địa chỉ tin cậy cho những tín đồ thời trang yêu thích phong cách, sự tinh tế và sự độc đáo.&lt;/p&gt;\r\n            \r\n            &lt;div style=\"margin-bottom: 30px;\"&gt;\r\n                &lt;h3 style=\"color: #333;\"&gt;Sứ Mệnh Của Chúng Tôi&lt;/h3&gt;\r\n                &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Tại &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt;, sứ mệnh của chúng tôi là mang đến cho khách hàng những trải nghiệm mua sắm tuyệt vời nhất. Chúng tôi không chỉ cung cấp những sản phẩm thời trang chất lượng mà còn chú trọng đến dịch vụ khách hàng hoàn hảo. Chúng tôi cam kết sẽ không ngừng nỗ lực để đem lại sự hài lòng tối đa cho bạn.&lt;/p&gt;\r\n            &lt;/div&gt;\r\n            \r\n            &lt;div style=\"margin-bottom: 30px;\"&gt;\r\n                &lt;h3 style=\"color: #333;\"&gt;Sản Phẩm Đa Dạng&lt;/h3&gt;\r\n                &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Chúng tôi cung cấp một loạt các sản phẩm thời trang từ quần áo, giày dép đến phụ kiện. Các bộ sưu tập của chúng tôi được cập nhật liên tục để bắt kịp xu hướng thời trang mới nhất trên thế giới. Cho dù bạn đang tìm kiếm phong cách cổ điển, hiện đại hay phá cách, &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt; đều có thể đáp ứng nhu cầu của bạn.&lt;/p&gt;\r\n            &lt;/div&gt;\r\n           \r\n            &lt;div style=\"margin-bottom: 30px;\"&gt;\r\n                &lt;h3 style=\"color: #333;\"&gt;Cam Kết Chất Lượng&lt;/h3&gt;\r\n                &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Chúng tôi cam kết chỉ cung cấp những sản phẩm có chất lượng tốt nhất. Mỗi sản phẩm tại &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt; đều trải qua quy trình kiểm tra chất lượng nghiêm ngặt trước khi đến tay khách hàng. Chúng tôi luôn đảm bảo rằng bạn sẽ hài lòng với mỗi sản phẩm mà bạn lựa chọn.&lt;/p&gt;\r\n            &lt;/div&gt;\r\n            \r\n            &lt;h3 style=\"color: #333;\"&gt;Hãy Đến Với Chúng Tôi&lt;/h3&gt;\r\n            &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Chúng tôi luôn chào đón bạn đến với &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt; để trải nghiệm sự khác biệt. Hãy để chúng tôi giúp bạn tỏa sáng và thể hiện phong cách của riêng mình. Cảm ơn bạn đã tin tưởng và lựa chọn &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt;.&lt;/p&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n&lt;/body&gt;\r\n\r\n&lt;/html&gt;\r\n</div>','2024-06-26 04:00:48','2024-06-27 03:29:02','2024-06-26 00:00:00',1,1,0,'magefan_blog/LQK_LOGO.png',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,20,0,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div&gt;&lt;p&gt;LQK Fashion - Nơi Thời Trang Tỏa Sáng&lt;/p&gt;&lt;div&gt;\r\n&lt;div&gt;&lt;p&gt;Chào mừng bạn đến với &lt;span style=\"color: #007bff; font-weight: bold;\"&gt;LQK Fashion&lt;/span&gt;, nơi mang đến cho bạn những sản phẩm thời trang đẹp nhất và chất lượng nhất. Chúng tôi tự hào là địa chỉ tin cậy cho những tín đồ thời trang yêu thích phong cách, sự tinh tế và sự độc đáo.&lt;/p&gt;&lt;div&gt;</div>',2),
(2,'Phong Cách Thời Trang - Xu Hướng Mùa Hè 2024',NULL,NULL,NULL,0,'phong-cach-thoi-trang',NULL,NULL,NULL,NULL,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;!DOCTYPE html&gt;\r\n&lt;html lang=\"vi\"&gt;\r\n\r\n&lt;head&gt;\r\n    &lt;meta charset=\"UTF-8\"&gt;\r\n    &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\r\n    &lt;title&gt;Phong Cách Ăn Mặc - Blog Thời Trang&lt;/title&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body style=\"font-family: Arial, sans-serif; line-height: 1.6; margin: 0; padding: 0; background-color: #f4f4f4;\"&gt;\r\n    &lt;div class=\"container\" style=\"width: 100%; margin: auto; overflow: hidden;\"&gt;\r\n        &lt;div class=\"main\" style=\"background: #fff;padding:10px ; box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);\"&gt;\r\n            &lt;h2 style=\"color: #333;\"&gt;1. Xu Hướng Thời Trang Mùa Hè 2024&lt;/h2&gt;\r\n            &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Mùa hè năm nay, những gam màu tươi sáng và chất liệu thoáng mát đang trở thành xu hướng chủ đạo. Những chiếc váy maxi mềm mại, áo sơ mi lụa và quần short denim đều là những lựa chọn tuyệt vời để giúp bạn tự tin và thoải mái trong những ngày nắng nóng.&lt;/p&gt;\r\n\r\n            &lt;h2 style=\"color: #333;\"&gt;2. Bí Quyết Phối Đồ Hoàn Hảo&lt;/h2&gt;\r\n            &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Phối đồ là một nghệ thuật. Để có một bộ trang phục hoàn hảo, bạn cần biết cách kết hợp màu sắc, kiểu dáng và phụ kiện sao cho hài hòa. Hãy thử phối áo sơ mi trắng với quần tây đen và thêm một đôi giày cao gót để tạo nên một bộ trang phục thanh lịch và tinh tế.&lt;/p&gt;\r\n\r\n            &lt;h2 style=\"color: #333;\"&gt;3. Lời Khuyên Từ Chuyên Gia&lt;/h2&gt;\r\n            &lt;p style=\"color: #666; margin-bottom: 15px;\"&gt;Chuyên gia thời trang luôn khuyên rằng bạn nên đầu tư vào những món đồ cơ bản và dễ kết hợp. Những chiếc áo thun đơn giản, quần jeans cạp cao hay áo khoác blazer là những item không thể thiếu trong tủ đồ của bạn. Hãy chú trọng vào chất lượng hơn là số lượng để có một tủ đồ đa dạng và bền vững.&lt;/p&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n&lt;/body&gt;\r\n\r\n&lt;/html&gt;</div><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\"></div>','2024-06-26 13:40:42','2024-06-27 02:17:03','2024-06-26 00:00:00',0,1,0,'magefan_blog/Flower-1.png',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,0,NULL,NULL,NULL),
(3,'Phong Cách Sống - Tìm Kiếm Sự Cân Bằng và Hài Lòng',NULL,NULL,NULL,0,'phong-cach-song-tim-kiem-su-can-bang-va-hai-long',NULL,NULL,NULL,NULL,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;!DOCTYPE html&gt;\r\n&lt;html lang=\"vi\"&gt;\r\n\r\n&lt;head&gt;\r\n    &lt;meta charset=\"UTF-8\"&gt;\r\n    &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\r\n    &lt;title&gt;Phong Cách Sống - Tìm Kiếm Sự Cân Bằng và Hài Lòng&lt;/title&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body style=\"font-family: \'Arial\', sans-serif; background-color: #f0f0f0; margin: 0; padding: 0;\"&gt;\r\n\r\n    &lt;header style=\"background-color: #333; color: #fff; text-align: center; padding: 20px 0;\"&gt;\r\n        &lt;div style=\"width: 80%; margin: auto;\"&gt;\r\n            &lt;h1 style=\"margin: 0;\"&gt;Phong Cách Sống Hiện Đại&lt;/h1&gt;\r\n            &lt;p style=\"margin: 5px 0 0;\"&gt;Hướng đến sự cân bằng và hài lòng trong cuộc sống&lt;/p&gt;\r\n        &lt;/div&gt;\r\n    &lt;/header&gt;\r\n\r\n    &lt;div style=\"width: 80%; margin: auto; overflow: hidden;\"&gt;\r\n        &lt;div style=\"background: #fff; padding: 20px; margin-top: 20px; box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);\"&gt;\r\n            &lt;h2 style=\"color: #333;\"&gt;1. Qu\r\n</div>','2024-06-26 14:52:43','2024-06-26 18:10:36','2024-06-26 00:00:00',0,1,0,NULL,NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL),
(4,'Hướng Dẫn Phối Đồ - Tự Tin Với Phong Cách Cá Nhân',NULL,NULL,NULL,0,'huong-dan-phoi-do-tu-tin-voi-phong-cach-ca-nhan',NULL,NULL,NULL,NULL,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;!DOCTYPE html&gt;\r\n&lt;html lang=\"vi\"&gt;\r\n\r\n&lt;head&gt;\r\n    &lt;meta charset=\"UTF-8\"&gt;\r\n    &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\r\n    &lt;title&gt;Hướng Dẫn Phối Đồ - Tự Tin Với Phong Cách Cá Nhân&lt;/title&gt;\r\n    &lt;style&gt;\r\n        body {\r\n            font-family: \'Arial\', sans-serif;\r\n            background-color: #f0f0f0;\r\n            margin: 0;\r\n            padding: 0;\r\n        }\r\n\r\n        header {\r\n            background-color: #333;\r\n            color: #fff;\r\n            text-align: center;\r\n            padding: 20px 0;\r\n        }\r\n\r\n        header h1 {\r\n            margin: 0;\r\n        }\r\n\r\n        header p {\r\n            margin: 5px 0 0;\r\n        }\r\n\r\n        .container {\r\n            width: 80%;\r\n            margin: auto;\r\n            overflow: hidden;\r\n        }\r\n\r\n        .main {\r\n            background: #fff;\r\n            padding: 20px;\r\n            margin-top: 20px;\r\n            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);\r\n        }\r\n\r\n        .main img {\r\n            max-width: 100%;\r\n            height: auto;\r\n            display: block;\r\n            margin-bottom: 20px;\r\n        }\r\n\r\n        .main h2 {\r\n            color: #333;\r\n        }\r\n\r\n        .main p {\r\n            color: #555;\r\n            line-height: 1.6;\r\n            margin-bottom: 20px;\r\n        }\r\n\r\n        footer {\r\n            background: #333;\r\n            color: #fff;\r\n            text-align: center;\r\n            padding: 10px 0;\r\n            margin-top: 20px;\r\n        }\r\n    &lt;/style&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body&gt;\r\n    &lt;header&gt;\r\n        &lt;div class=\"container\"&gt;\r\n            &lt;h1&gt;Hướng Dẫn Phối Đồ&lt;/h1&gt;\r\n            &lt;p&gt;Tự tin thể hiện phong cách cá nhân với các mẹo phối đồ thông minh&lt;/p&gt;\r\n        &lt;/div&gt;\r\n    &lt;/header&gt;\r\n\r\n    &lt;div class=\"container\"&gt;\r\n        &lt;div class=\"main\"&gt;\r\n            &lt;h2&gt;1. Phối Đồ Cho Môi Trường Công Sở&lt;/h2&gt;\r\n            &lt;img src=\"https://images.unsplash.com/photo-1563941401-8740df60cb54\" alt=\"Phối Đồ Công Sở\"&gt;\r\n            &lt;p&gt;Trang phục công sở không chỉ cần lịch sự mà còn phải thoải mái và thể hiện sự chuyên nghiệp. Hãy bắt đầu với những món đồ cơ bản như áo sơ mi trắng, quần tây hoặc chân váy bút chì. Kết hợp chúng với một chiếc áo blazer để thêm phần trang trọng. Đừng quên chọn giày và phụ kiện như đồng hồ hoặc túi xách để hoàn thiện bộ trang phục.&lt;/p&gt;\r\n            &lt;p&gt;Nếu bạn muốn tạo thêm điểm nhấn, hãy thử phối đồ với các màu sắc tươi sáng hoặc họa tiết nhẹ nhàng. Chẳng hạn, một chiếc khăn quàng cổ màu pastel có thể làm cho trang phục trở nên nổi bật hơn mà vẫn giữ được vẻ thanh lịch.&lt;/p&gt;\r\n\r\n            &lt;h2&gt;2. Trang Phục Thể Thao Phong Cách&lt;/h2&gt;\r\n            &lt;img src=\"https://images.unsplash.com/photo-1562060627-f99e0b6eb335\" alt=\"Trang Phục Thể Thao\"&gt;\r\n            &lt;p&gt;Phong cách thể thao không chỉ dành cho phòng gym mà còn rất phù hợp cho các hoạt động hàng ngày. Hãy thử kết hợp quần leggings với áo thun dáng rộng và một đôi giày thể thao. Bạn có thể thêm một chiếc áo khoác bomber để tạo thêm sự năng động và thoải mái.&lt;/p&gt;\r\n            &lt;p&gt;Đừng ngại thử các màu sắc nổi bật hoặc họa tiết cá tính. Các phụ kiện như mũ lưỡi trai hay ba lô nhỏ cũng giúp bạn trông phong cách và tiện lợi hơn trong các hoạt động ngoài trời.&lt;/p&gt;\r\n\r\n            &lt;h2&gt;3. Phối Đồ Dạo Phố Cuối Tuần&lt;/h2&gt;\r\n            &lt;img src=\"https://images.unsplash.com/photo-1592437182481-3c3038b497c2\" alt=\"Phối Đồ Dạo Phố\"&gt;\r\n            &lt;p&gt;Cuối tuần là thời gian để thư giãn và tận hưởng, vì vậy hãy chọn những bộ trang phục thoải mái nhưng vẫn thời trang. Một chiếc váy maxi thoáng mát hoặc quần short kết hợp với áo thun sẽ là lựa chọn lý tưởng cho những buổi dạo phố.&lt;/p&gt;\r\n            &lt;p&gt;Kết hợp trang phục với giày dép thoải mái như sandals hoặc sneakers và thêm một chiếc mũ rộng vành để bảo vệ bạn khỏi nắng. Phụ kiện như kính râm và túi tote cũng là những lựa chọn tuyệt vời để hoàn thiện phong cách dạo phố.&lt;/p&gt;\r\n\r\n            &lt;h2&gt;4. \r\n</div>','2024-06-26 15:08:20','2024-06-26 18:10:48','2024-06-26 00:00:00',0,1,0,NULL,NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL),
(5,'Tổng hợp 4 gam màu xanh hot nhất hè 2024 dành cho Quý cô',NULL,NULL,NULL,0,'quan-culottes-–-item-danh-cho-quy-co-hien-dai',NULL,NULL,NULL,NULL,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;!DOCTYPE html&gt;\r\n&lt;html lang=\"vi\"&gt;\r\n\r\n&lt;head&gt;\r\n    &lt;meta charset=\"UTF-8\"&gt;\r\n    &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\r\n    &lt;title&gt;Phong Cách Thời Trang - Xu Hướng Mùa Hè&lt;/title&gt;\r\n    &lt;style&gt;\r\n        .blog-container h3 {\r\n             font-size:1.6em\r\n        }\r\n        .blog-container span {\r\n             font-size:1.2em\r\n        }\r\n        .blog-container img {\r\n             max-width: 47%;\r\n             height: auto;\r\n        }\r\n    &lt;/style&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body style=\"font-family: Arial, sans-serif; line-height: 1.6; margin: 0; padding: 0; background-color: None\"&gt;\r\n    &lt;div class=\"blog-container\" style=\"width: 100%; margin: auto; overflow: hidden;\"&gt;\r\n        &lt;div class=\"main\" style=\"margin-top: 10px;\"&gt;\r\n            &lt;h3 style=\"color: #333;\"&gt;Xanh Cerulean – màu sắc của bầu trời thanh bình&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Theo Viện Màu Sắc Pantone, màu xanh Cerulean được định nghĩa là “màu sắc của bầu trời vào những ngày nắng thanh bình, trong vắt”. Trong một bài báo được trích dẫn, Pantone cũng chỉ ra rằng Cerulean là gam màu mang đến nguồn cảm hứng cho sự sáng tạo và khéo léo trong Xuân Hè 2024.&lt;/span&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Vì vậy, những trang phục với gam màu Cerulean làm chủ đạo sẽ mang đến cho người mặc sự tươi sáng, tự tin và tràn đầy hứng khởi, tạo nên một khởi đầu mới đầy năng lượng trong mùa Hạ này.&lt;/span&gt;\r\n            \r\n            &lt;h3 style=\"color: #333;\"&gt;Xanh mint – Màu sắc của thanh xuân trong trẻo&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Xanh mint – gam màu của vẻ đẹp trong trẻo và tinh khôi. Trang phục với gam màu này gợi lên sự tươi mới và thanh xuân. Bên cạnh đó, sắc xanh mint còn biểu trưng cho sự đoàn tụ và viên mãn, mang đến một câu chuyện thanh xuân trọn vẹn.&lt;/span&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/3.png}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/2.png}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n            &lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Gam màu này cực kỳ phổ biến và thành công trong các thiết kế thời trang, nhấn mạnh vào sức sống tươi mới và sự phá cách của người mặc. Trong những ngày đầu mùa rực rỡ, trang phục xanh mint sẽ tạo điểm nhấn đặc biệt cho các nàng, giúp họ tỏa sáng và thu hút mọi ánh nhìn.&lt;/span&gt;\r\n            \r\n            &lt;h3 style=\"color: #333;\"&gt;Xanh Navy – gam màu của sự thư giãn thoải mái nhất&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Gam màu xanh navy dễ gợi đến không gian đại dương sâu thẳm và sự chiêm nghiệm. Đây là gam màu rất được các tín đồ thời trang yêu thích bởi sự linh hoạt và “dễ tính”. Bạn có thể dễ dàng kết hợp xanh navy với các màu sắc khác như đỏ, cam, vàng, thậm chí là tím. Theo nghiên cứu của G.F. Smith, màu xanh navy mang đến sự thư giãn thoải mái nhất. Vì vậy, đây là lựa chọn tuyệt vời để làm cho ngày hè của bạn thêm ấn tượng.&lt;/span&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/4.jpeg}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/4.jpeg}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n            &lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Đặc biệt, xanh navy thuộc gam màu xanh trầm, giúp các nàng có thể hack dáng cực hiệu quả với trang phục mang màu sắc này.&lt;/span&gt;\r\n            \r\n            &lt;h3 style=\"color: #333;\"&gt;Xanh lục đậm – gam màu của sức sống của cây cỏ hoa lá&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Có rất nhiều lựa chọn trang phục với gam màu này trong những ngày hè đầy nắng. Vì vẻ đẹp tinh khôi trong trẻo của cây cỏ hoa lá giúp mang lại cho người mặc nét đẹp ấn tượng. Tượng trưng sự phát triển, mang lại cảm giác an toàn cho người mặc cũng như người xung quanh. Vì vậy, trang phục với gam màu này mang đến cho nàng nguồn cảm hứng vô tận trong những ngày hè.&lt;/span&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/5.png}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/4/6.png}}\" alt=\"\" style=\"max-width: 45%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n\r\n&lt;/body&gt;\r\n\r\n&lt;/html&gt;</div>','2024-06-26 20:33:00','2024-06-27 03:52:30','2024-06-26 00:00:00',1,1,0,'magefan_blog/1.png',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,38,0,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;p&gt;Nhắc đến gam màu của ngày hè thì chắc chắn không thể kể đến gam màu xanh ngọt ngào, đủ trong trẻo, đủ mãnh liệt và đủ ấn tượng. Mỗi sắc xanh khác nhau từ sắc màu của bầu trời, đến cả những màu của biển cả hay gam màu xanh lục của thiên nhiên,… đều mang những ý nghĩa và nguồn cảm hứng riêng trong mỗi bộ trang phục.&lt;/p&gt;</div>',NULL),
(6,'Trang phục cho những chuyến đi dã ngoại mùa hè 2024',NULL,NULL,NULL,0,'trang-phuc-cho-nhung-chuyen-di-da-ngoai-mua-he-2024',NULL,NULL,NULL,NULL,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;!DOCTYPE html&gt;\r\n&lt;html lang=\"vi\"&gt;\r\n\r\n&lt;head&gt;\r\n    &lt;meta charset=\"UTF-8\"&gt;\r\n    &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\r\n    &lt;title&gt;Trang phục cho những chuyến đi dã ngoại mùa hè 2024&lt;/title&gt;\r\n    &lt;style&gt;\r\n        .blog-container h3 {\r\n             font-size:1.6em\r\n        }\r\n        .blog-container span {\r\n             font-size:1.2em\r\n        }\r\n        .blog-container img {\r\n             max-width: 47%;\r\n             height: auto;\r\n        }\r\n    &lt;/style&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body style=\"font-family: Arial, sans-serif; line-height: 1.6; margin: 0; padding: 0;\"&gt;\r\n    &lt;div class=\"blog-container\" style=\"width: 100%; margin: auto; overflow: hidden;\"&gt;\r\n        &lt;div class=\"main\" style=\"margin-top: 10px;\"&gt;\r\n            &lt;h3 style=\"color: #333;\"&gt;Phong cách Cottagecore nhẹ nhàng trong những thiết kế đầm&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Phong cách Cottagecore là xu hướng thời trang đã được các Quý cô yêu thích và lựa chọn rất nhiều. Phong cách thời trang này tạo được cảm giác về sự bình yên, trong trẻo và nhẹ nhàng. Do vậy, điểm nhấn ở các chi tiết hay kiểu dáng nhẹ nhàng của trang phục thuộc phong cách thời trang này thường được lựa chọn các gam màu thiên nhiên dịu nhẹ như màu pastel, màu nâu hoặc màu be,…&lt;/span&gt;&lt;br&gt;&lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Đặc biệt, các thiết kế đầm liền với phần chân váy xòe chắc chắn là “người cộng sự” tuyệt vời giúp các nàng có thể có được những bức ảnh ưng ý cho chuyến đi chơi. Một bật mí nhỏ cho nàng là có thể ưu tiên họa tiết hoa nhí trẻ trung, hiện đại và cực “trending” cho người mặc.&lt;/span&gt;&lt;br&gt;&lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Ngoài ra, dựa vào vóc dáng cơ thể cũng như phong cách cá nhân riêng của mình thì các nàng cũng có thể lựa chọn được thiết kế đầm phù hợp. Nếu bạn thích sự trẻ trung, hiện đại và che đi khuyết điểm của vòng eo hay vòng 3 chưa chuẩn thì các mẫu đầm suông chính là lựa chọn hoàn hảo nhất.&lt;/span&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/5/2.png}}\" alt=\"\" style=\"max-width: 47%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/5/3.png}}\" alt=\"\" style=\"max-width: 47%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n            &lt;h3 style=\"color: #333;\"&gt;Set bộ theo phong cách monochrome trẻ trung&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Các cô nàng cũng đừng quên một set đồ thật trẻ trung cho chuyến dã ngoại đầu xuân với set đồ gồm áo sơ mi cách điệu và quần short năng động. Trang phục có ảnh hưởng rất lớn đến cảm xúc. Do vậy, để mang nguồn năng lượng tích cực cũng như sự thư giãn, thoải mái và dễ chịu thì bạn có thể ưu ái lựa chọn những gam màu sáng cùng họa tiết nổi bật.&lt;/span&gt;&lt;br&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/5/4.png}}\" alt=\"\" style=\"max-width: 94%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n            &lt;h3 style=\"color: #333;\"&gt;Thanh lịch với quần culottes và áo cách điệu&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Một gợi khác cho các nàng với outfit ấn tượng trong chuyến đi chơi đó chính là quần culottes cùng áo cách điệu. Quần culottes với dáng suông, rộng, rất được lòng các Quý cô yêu thích thời trang trong những năm gần đây. Bởi vì chúng không sẽ mang đến sự thanh lịch và cực kỳ “dễ tình” khi phối đồ, tạo được sự trẻ trung.&lt;/span&gt;&lt;br&gt;\r\n            &lt;h3 style=\"color: #333;\"&gt;Outfit với chân váy dài cho chuyến đi chơi năng động, hiện đại&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Chân váy dài – item quan trọng trong tủ đồ của các chị em. Trang phục này có thể phù hợp với trong môi trường công sở hoặc được sử dụng rất nhiều trong các chuyến đi chơi với những thiết kế có hoạ tiết và tone màu nổi bật, gây thu hút hay phối đồ mang phong cách cá tính riêng.&lt;/span&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/5/5.png}}\" alt=\"\" style=\"max-width: 47%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/5/6.png}}\" alt=\"\" style=\"max-width: 47%; height: auto;\"/&gt;\r\n            &lt;/div&gt;&lt;br&gt;\r\n            &lt;span&gt;Để ghi điểm cho những set đồ của mình, các cô nàng cần lựa chọn những phụ kiện đi cùng để có tổng thể hài hòa, ấn tượng. Khuyên tai, vòng cổ, túi xách hay giày cao gót,… là những phụ kiện rất quan trọng cho set đồ của các cô nàng.&lt;/span&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n\r\n&lt;/body&gt;\r\n\r\n&lt;/html&gt;</div>','2024-06-27 03:44:27','2024-06-27 04:06:26','2024-06-27 00:00:00',1,1,0,'magefan_blog/12.png',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,0,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div&gt;&lt;p&gt;Trong những ngày tiết trời dịu nhẹ, rất được lòng người thì chắc chắn không thể thiếu những chuyến dã ngoại. Nhiều người lựa chọn miền quê thanh vắng, yên bình hoặc vùng ngoại ô, để giúp bạn có thể “refresh” tinh thần với nguồn năng lượng dồi dào và nguồn cảm hứng cho công việc.&lt;/p&gt;&lt;/div&gt;</div>',NULL),
(7,'Gam màu lấy lòng Quý cô trong thời trang hè 2024',NULL,NULL,NULL,0,'gam-mau-lay-long-quy-co-trong-thoi-trang-he-2024',NULL,NULL,NULL,NULL,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;!DOCTYPE html&gt;\r\n&lt;html lang=\"vi\"&gt;\r\n\r\n&lt;head&gt;\r\n    &lt;meta charset=\"UTF-8\"&gt;\r\n    &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\r\n    &lt;title&gt;Trang phục cho những chuyến đi dã ngoại mùa hè 2024&lt;/title&gt;\r\n    &lt;style&gt;\r\n        .blog-container h3 {\r\n             font-size:1.6em\r\n        }\r\n        .blog-container span {\r\n             font-size:1.2em\r\n        }\r\n        .blog-container img {\r\n             max-width: 47%;\r\n             height: auto;\r\n        }\r\n    &lt;/style&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body style=\"font-family: Arial, sans-serif; line-height: 1.6; margin: 0; padding: 0;\"&gt;\r\n    &lt;div class=\"blog-container\" style=\"width: 100%; margin: auto; overflow: hidden;\"&gt;\r\n        &lt;div class=\"main\" style=\"margin-top: 10px;\"&gt;\r\n            &lt;h3 style=\"color: #333;\"&gt;Gam màu tươi sáng và sôi động dành cho mùa hè&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Nếu màu gam màu cam tươi sáng tạo sự tươi mới và năng động, thì màu hồng pastel mang đến cảm quan về sự dịu dàng và nữ tính, còn màu xanh mint tượng trưng cho sự mát mẻ và tươi trẻ.&lt;/span&gt;&lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Màu cam tươi sáng, với sự rạng rỡ và năng động, như là cơn gió mát mẻ của mùa hè, làm tươi mới mọi góc nhìn và mang lại cảm giác hứng khởi.&lt;/span&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/6/2.png}}\" alt=\"\" style=\"max-width: 47%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/6/3.png}}\" alt=\"\" style=\"max-width: 47%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Trong khi đó, màu hồng pastel dịu dàng và nữ tính như làn gió nhẹ nhàng, làm say đắm trái tim và tạo nên vẻ đẹp mộng mơ của mùa hè.&lt;/span&gt;&lt;br&gt;\r\n            \r\n            &lt;h3 style=\"color: #333;\"&gt;Gam màu quyến rũ và lôi cuốn của màu hè&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Trong thế giới thời trang hè, gam màu quyến rũ và lôi cuốn như màu vàng nắng và ánh tím tinh tế là điểm nhấn không thể thiếu, tạo nên sức hút và sự sang trọng đặc biệt dành cho nàng.&lt;/span&gt;&lt;br&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/6/vay-vang-3.jpg}}\" alt=\"\" style=\"max-width: 33%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/6/vay-vang-2.jpg}}\" alt=\"\" style=\"max-width: 33%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/6/vay-vang-1.jpg}}\" alt=\"\" style=\"max-width: 33%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n            &lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Màu vàng nắng tương đồng với ánh sáng ấm áp và lôi cuốn, mang đến điểm nhấn như một cơn gió mát mẻ của mùa hè, siêu tôn da và tạo điểm nhấn cho bất kỳ trang phục nào. Trái ngược với đó, màu ánh tím tinh tế mang lại sự sang trọng và thanh lịch nhưng lại vô cùng dịu nhẹ trong những ngày hè chuyển nắng. Cả hai gam màu đều giúp nàng ghi điểm cho set đồ của mình rất tốt đó nha!&lt;/span&gt;&lt;br&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n\r\n&lt;/body&gt;\r\n\r\n&lt;/html&gt;</div>','2024-06-27 05:03:18','2024-06-27 05:16:48','2024-06-27 00:00:00',1,1,0,'magefan_blog/1_1.png',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div&gt;&lt;p&gt;Mùa hè không chỉ là thời gian để nàng tận hưởng những ngày nghỉ thư giãn, mà còn là cơ hội để khám phá và thể hiện phong cách cá nhân thông qua sự sắp xếp tinh tế của màu sắc với nhiều outfit nổi bật. Trong bài viết này, chúng ta sẽ đắm mình vào thế giới đầy màu sắc của thời trang hè và khám phá những gam màu đầy lôi cuốn lấy lòng quý cô trong mùa nắng sôi động này&lt;/p&gt;&lt;/div&gt;</div>',NULL),
(8,'Nguyên tắc đơn giản mà giúp nàng thăng hạng set đồ công sở rất hiệu quả',NULL,NULL,NULL,0,'nguyen-tac-don-gian-ma-giup-nang-thang-hang-set-do-cong-so-rat-hieu-qua',NULL,NULL,NULL,NULL,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;!DOCTYPE html&gt;\r\n&lt;html lang=\"vi\"&gt;\r\n\r\n&lt;head&gt;\r\n    &lt;meta charset=\"UTF-8\"&gt;\r\n    &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\r\n    &lt;title&gt;Trang phục cho những chuyến đi dã ngoại mùa hè 2024&lt;/title&gt;\r\n    &lt;style&gt;\r\n        .blog-container h3 {\r\n             font-size:1.6em\r\n        }\r\n        .blog-container span {\r\n             font-size:1.2em\r\n        }\r\n        .blog-container img {\r\n             max-width: 47%;\r\n             height: auto;\r\n        }\r\n    &lt;/style&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body style=\"font-family: Arial, sans-serif; line-height: 1.6; margin: 0; padding: 0;\"&gt;\r\n    &lt;div class=\"blog-container\" style=\"width: 100%; margin: auto; overflow: hidden;\"&gt;\r\n        &lt;div class=\"main\" style=\"margin-top: 10px;\"&gt;\r\n            &lt;h3 style=\"color: #333;\"&gt;Ba gam màu quen thuộc và không bao giờ lỗi mốt&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Ba tone màu đen, trắng và xám luôn là không thể thiếu trong tủ đồ của các nàng. Những gam màu trung tính, rất dễ phối đồ và nhấn mạnh vẻ đẹp trang trọng, rất nhã nhặn. &lt;/span&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/7/2.png}}\" alt=\"\" style=\"max-width: 47%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/7/3.png}}\" alt=\"\" style=\"max-width: 47%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Trong những năm gần đây, tone màu trung tính này trong xu hướng thời trang tối giản được các tín đồ thời trang rất ưa chuộng. Với phương châm “Simple is the best” trở thành xu hướng lựa chọn những trang phục tối giản, ít họa tiết. Chắc chắc những outfit với gam màu này sẽ giúp nàng trở nên tự tin trong những cuộc họp hay gặp gỡ quan trọng cùng các đối tác, đồng nghiệp.&lt;/span&gt;&lt;br&gt;\r\n            \r\n            &lt;h3 style=\"color: #333;\"&gt;Những chất liệu sang trọng nhưng rất “dễ tính” khi mix đồ&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Hiện nay, có rất nhiều chất liệu vải từ tự nhiên an toàn và giúp giữ được form dáng trang phục rất tốt, trong số đó phải để đến vải linen.&lt;/span&gt;&lt;br&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/7/4.png}}\" alt=\"\" style=\"max-width: 94%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n            &lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Linen là một trong những loại vải được rất nhiều hãng thời trang sử dụng. Với nguồn gốc hoàn toàn tự nhiên, an toàn cho sức khỏe của người mặc. Đồng thời, độ nhăn tự nhiên của linen còn tạo được điểm nhấn, rất thu hút của trang phục được thiết kế từ loại vải này. Hiện nay, chất liệu này được sử dụng trong rất nhiều items khác nhau mà các nàng có thể lựa chọn.&lt;/span&gt;&lt;br&gt;\r\n\r\n            &lt;h3 style=\"color: #333;\"&gt;Cách điệu với nhiều họa tiết trẻ trung, hiện đại&lt;/h3&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Nếu bạn là cô nàng yêu thích phong cách thời trang trẻ trung, hiện đại thì có thể sử dụng những trang phục kết hợp với các họa tiết. Một số họa tiết không thể bỏ qua đó là họa tiết caro trẻ trung hay họa tiết floral dịu dàng nữ tính cùng với đó là họa tiết thổ cẩm độc đáo. &lt;/span&gt;&lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Đầm hoa cũng là những gợi ý hàng đầu cho những cô nàng công sở. Sự duyên dáng, nhẹ nhàng của váy đầm kết hợp cùng với sự nữ tính của họa tiết Floral sẽ giúp các nàng ghi được sự chú ý của các cô nàng.&lt;/span&gt;&lt;br&gt;&lt;br&gt;\r\n            &lt;div class=\"image-column\" style=\"display: flex; flex-direction: row; align-items: center;justify-content: space-between;background: #fff\"&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/7/5.png}}\" alt=\"\" style=\"max-width: 33%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/7/6.png}}\" alt=\"\" style=\"max-width: 33%; height: auto;\"/&gt;\r\n            &lt;img src=\"{{media url=.renditions/wysiwyg/blog/7/7.png}}\" alt=\"\" style=\"max-width: 33%; height: auto;\"/&gt;\r\n            &lt;/div&gt;\r\n            &lt;br&gt;\r\n            &lt;span style=\"color: #666; margin-bottom: 15px;\"&gt;Linen là một trong những loại vải được rất nhiều hãng thời trang sử dụng. Với nguồn gốc hoàn toàn tự nhiên, an toàn cho sức khỏe của người mặc. Đồng thời, độ nhăn tự nhiên của linen còn tạo được điểm nhấn, rất thu hút của trang phục được thiết kế từ loại vải này. Hiện nay, chất liệu này được sử dụng trong rất nhiều items khác nhau mà các nàng có thể lựa chọn.&lt;/span&gt;&lt;br&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n\r\n&lt;/body&gt;\r\n\r\n&lt;/html&gt;</div>','2024-06-27 05:30:33','2024-06-27 05:31:43','2024-06-27 00:00:00',1,1,0,'magefan_blog/1_2.png',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,NULL,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div&gt;&lt;p&gt;Không còn quá xa lạ với hình ảnh những cô nàng đứng hàng giờ trước tủ đồ để lựa chọn trang phục vào buổi sáng. Lựa chọn item gì và kết hợp như thế nào luôn là vấn đề rất băn khoăn. Vì vậy, đừng quên tham khảo những nguyên tắc dưới đây...&lt;/p&gt;&lt;/div&gt;</div>',NULL);
